import React from 'react';


const AnnounceBar = () => {
    return (
        <div className="announceBar">
            <svg>
            <image  href="./logo.svg" alt="logo" />
            </svg>

            <p className="text" > Web Development </p>
        </div>
    );
};

export default AnnounceBar;
